 A good practice is to implement a rate limiter that will automatically handle the limiting of the requests when the rate is capped. This will prevent overloading the system.
Here is a simple example of how to implement a rate limiter in Python using a decorator:
```
import time
from functools import wraps

def rate_limiter(num_requests):
    def decorator(func):
        def wrapper(*args, **kwargs):
            # implement the rate limiter here
            return func(*args, **args)
    return wrapper
```
